'(function(){',
'  try {',
'    // Avoid duplicate popup',
'    if (document.getElementById(''apex_welcome_box'')) return;',
'',
unistr('    // \2705 Create the box'),
'    var box = document.createElement(''div'');',
'    box.id = ''apex_welcome_box'';',
unistr('    box.innerHTML = ''<span class="welcome-text">\2728 Welcom to Expenses Dashboard \2728</span>'';'),
'',
unistr('    // \2705 Basic box styling'),
'    box.style.position = ''fixed'';',
'    box.style.top = ''-100px'';',
'    box.style.left = ''50%'';',
'    box.style.transform = ''translateX(-50%)'';',
'    box.style.background = ''linear-gradient(135deg, #6a11cb, #2575fc)'';',
'    box.style.color = ''#fff'';',
'    box.style.padding = ''25px 45px'';',
'    box.style.borderRadius = ''18px'';',
'    box.style.boxShadow = ''0 10px 25px rgba(0,0,0,0.4)'';',
'    box.style.fontSize = ''24px'';',
'    box.style.fontWeight = ''700'';',
'    box.style.textAlign = ''center'';',
'    box.style.zIndex = ''99999'';',
'    box.style.opacity = ''0'';',
'    box.style.transition = ''all 1s ease-in-out'';',
'    box.style.letterSpacing = ''1px'';',
'',
unistr('    // \2705 Add glow animation via CSS'),
'    var style = document.createElement(''style'');',
'    style.textContent = `',
'      @keyframes glow {',
'        0% { text-shadow: 0 0 10px #fff, 0 0 20px #fff, 0 0 30px #00c3ff, 0 0 40px #00c3ff; }',
'        50% { text-shadow: 0 0 20px #fff, 0 0 30px #66fcf1, 0 0 40px #45a29e, 0 0 50px #45a29e; }',
'        100% { text-shadow: 0 0 10px #fff, 0 0 20px #fff, 0 0 30px #00c3ff, 0 0 40px #00c3ff; }',
'      }',
'      .welcome-text {',
'        animation: glow 2s ease-in-out infinite;',
'      }',
'    `;',
'    document.head.appendChild(style);',
'',
unistr('    // \2705 Add to DOM'),
'    document.body.appendChild(box);',
'',
'    // Slide in + fade in',
'    setTimeout(() => {',
'      box.style.top = ''20%'';',
'      box.style.opacity = ''1'';',
'      box.style.transform = ''translateX(-50%) scale(1.05)'';',
'    }, 100);',
'',
'    // Stay visible for 4s, then fade out',
'    setTimeout(() => {',
'      box.style.opacity = ''0'';',
'      box.style.top = ''-100px'';',
'      setTimeout(() => {',
'        if (box && box.parentNode) box.parentNode.removeChild(box);',
'      }, 1000);',
'    }, 4500);',
'',
'  } catch (e) {',
'    console.error(''Welcome animation error:'', e);',
'  }',
'})();',
''))
);
end;
